import axios from "axios";
import React from "react";
import { Route,Routes } from "react-router-dom";
// // // import axios from "axios";
import ImageUploader from "./pages/ImageUploader";
import Pdf from './pages/PDFview';
// import pdf from "./utils/wnj.pdf"
// import MyRouter from "./utils/router";

function App(){
//   onload(){
// sssss
//   }
    const [pdf]=  ""


    return (
        
            <div>
                
                <Routes>

                    <Route path="/*" element={<ImageUploader />}></Route>

                    <Route path="/wuwenjin" element={<Pdf prfUrl={pdf} />}></Route>
                </Routes>
        
            </div>
    )
}
 
export default App;
